import * as React from "react";
import { Box } from "@mui/system";
import HistoricalData from "./historical_data";

class Chart extends React.Component {

    constructor(props) {
        super(props);
    }  

    render () {
        return (
            <Box sx={{
                boxShadow: 10,
                borderRadius: 10,
                p: 2,
                minWidth: 1200,
                minHeight: 1200,

            }} >           
                <div>
                    current age {this.props.currentage} 
                    portfolio value {this.props.portfoliovalue}
                </div>
                <HistoricalData />
             </Box>

        );
    };
};

export default Chart;
